import { Button, Card, CardHeader, CardBody, CardFooter } from 'grommet';
import { Menu } from 'grommet-icons';

export default function Task ( task ) {
	return (
		<Card>
			<CardHeader> {task.id} </CardHeader>
			<CardBody> {task.description} </CardBody>
			<CardFooter>
				    <Button icon={<Menu/>}/>
			</CardFooter>
		</Card>
	);
}
